question:
Reformatted Question: Ibrahim is raising money for a <fact1>2-day conference</fact1>. Each day costs <fact2>$200 for hotel</fact2>, <fact3>$30 for food</fact3>, and <fact4>$30 for transportation</fact4>. Ibrahim only has <fact5>$95</fact5>. His friends have chipped in and will cover the cost of <fact6>all the food for the conference</fact6>. Ibrahim has also applied for help from the school, which has decided to cover <fact7>a quarter of the remaining cost of the conference</fact7>. How much money is Ibrahim still missing?

Answer: The total cost of the conference per day is <fact2>$200 (hotel)</fact2> + <fact3>$30 (food)</fact3> + <fact4>$30 (transportation)</fact4> = $260.  For a <fact1>2-day conference</fact1>, the total cost is 2 * $260 = $520.  His friends are covering <fact6>all the food</fact6>, which is 2 days * <fact3>$30/day</fact3> = $60.  So the remaining cost after his friends' contribution is $520 - $60 = $460. The school is covering <fact7>a quarter</fact7> of this, which is $460 / 4 = $115.  Therefore, the amount Ibrahim still needs to raise is $460 - $115 = $345.  Since he already has <fact5>$95</fact5>, he is still missing $345 - $95 = $250.

The answer is {250}
